PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?populationBefore2010 ?timeBefore2010 ?populationAfter2010 ?timeAfter2010 WHERE {
  {
    wd:Q183 p:P1082 ?populationStatementBefore .
    ?populationStatementBefore pq:P585 ?timeBefore2010 ; ps:P1082 ?populationBefore2010 .
    FILTER ( ?timeBefore2010 < '2010-01-01' ^^ xsd:dateTime )
  } UNION {
    wd:Q183 p:P1082 ?populationStatementAfter .
    ?populationStatementAfter pq:P585 ?timeAfter2010 ; ps:P1082 ?populationAfter2010 .
    FILTER ( ?timeAfter2010 >= '2010-01-01' ^^ xsd:dateTime )
  }
}
ORDER BY DESC ( ?timeBefore2010 ) ASC ( ?timeAfter2010 )
LIMIT 1

